import { NavLink } from 'react-router-dom';
import clasess from './MainNavigation.module.css';

const Nav=()=>{
    return <header className={clasess.header}>
        <ul>
            <li><NavLink to='/qutes'>all Qutes</NavLink></li>
            <li><NavLink to='/qute'>Add a qute</NavLink></li>
        </ul>
    </header>
}
export default Nav;
